WriteF4EXIT proc
	                                    mov       al, 0
	                                    mov       bh, 0
	                                    mov       bl, 00011111b
	                                    mov       cx, 8                                       	; calculate message size.
	                                    mov       dl, 35
	                                    mov       dh, 1
	                                    push      cs
	                                    pop       es
	                                    mov       bp, offset msg1
	                                    mov       ah, 13h
	                                    int       10h
	                                    jmp       msg1end
	msg1                                db        "F4: Exit"
	msg1end:                            
	                                    ret
WriteF4EXIT endp

setdevisor proc

	                                    mov       dx,3fbh                                     	; Line Control Register
	                                    mov       al,10000000b                                	;Set Divisor Latch Access Bit
	                                    out       dx,al

	                                    mov       dx,3f8h
	                                    mov       al,0ch
	                                    out       dx,al

	                                    mov       dx,3f9h
	                                    mov       al,00h
	                                    out       dx,al

	                                    mov       dx,3fbh
	                                    mov       al,00011011b

	                                    out       dx,al



	                                    ret
setdevisor endp


ChatProc PROC
	                                    MOV       AX, @DATA
	                                    MOV       DS, AX
		
	                   
		
	                                    MOV       AX, 0600h                                   	; Scroll up function
	                                    mov       cx, 0
	                                    MOV       DX, 184FH                                   	; lower right corner DH=row, DL=column
	                                    MOV       BH, 07
	                                    INT       10H
		
	                                    Cursor    0, 0
		
	                                    Cursor    00H, 0CH

	                                    MOV       AH, 9                                       	;Display string function
	                                    MOV       DX, OFFSET Divisor                          	;offset of the string
	                                    INT       21H
		
	                                    Cursor    0, 0
		
		
		
	;MAIN LOOP ==> Infinite LOOP as long as the program is running
	CHECKCHAT:                          
	                                    MOV       CharRecieved, '$'
	;We have two possibilities: 1) Sending 2) Recieve
	                                    MOV       AH, 1                                       	;keep scanning the keyboard continously
	                                    INT       16H                                         	;drX execution
	                                    JNZ       SEND                                        	;A key is pressed maybe char to send or exit chat request
	                                    JMP       RES                                         	;No keys are pressed then go check receiving end
			
	SEND:                               

	                                    cmp       AH, 61
	                                    jZ        End_Of_Chat_Module

	                                    MOV       AH, 0                                       	;wait for a key press
	                                    INT       16H                                         	;drX execution

	                                    CMP       AH, 1CH                                     	;ENTER key
	                                    JZ        EnterCheck
				
	                                    CMP       AL, 27                                      	;ESC key
	                                    JZ        EscapeFix
				
	                                    CMP       AL, 08                                      	;Backspace
	                                    JZ        Backspace
				
	                                    MOV       Char, AL
	                                    Cursor    X_1, Y_1
	                                    MOV       AH, 9                                       	;Display string
	                                    MOV       DX, offset Char                             	;offset of the string
	                                    INT       21H
	                                    SENDING   Char
				
	                                    INC       X_1
	                                    CMP       X_1, 80
	                                    JE        ColLimitPassFix
	BACKSEND:                           
	                                    JMP       RES
			
			
	EnterCheck:                         
	                                    MOV       X_1, 0
	                                    ADD       Y_1, 1
	                                    CMP       Y_1, 12
	                                    JE        NewLine1
	ContinueSending:                    
	                                    Cursor    X_1, Y_1
	                                    SENDING   0CH
	                                    JMP       ENDSEND
				
	EscapeFix:                          
	                                    MOV       AX, 0600h                                   	; Scroll up function
	                                    XOR       CX, CX                                      	; Upper left corner CH=row, CL=column 0
	                                    MOV       DX, 184FH                                   	; Bottom right corner DH=row, DL=column
	                                    MOV       BH, 07
	                                    INT       10H
	                                    Cursor    0, 0
	                                    MOV       AH, 9                                       	;Display string function
	                                    INT       21H
	ColLimitPassFix:                    
	                                    JMP       COLOVERFLOW
	Backspace:                          
	                                    Cursor    X_1, Y_1
	                                    MOV       AH, 9                                       	;Display string function
	                                    MOV       DX, OFFSET Space_chat                       	;offset of the string
	                                    INT       21H
	                                    DEC       X_1
	                                    Cursor    X_1, Y_1
	                                    SENDING   Space_chat
	                                    JMP       ENDSEND
			
	JMPCHECKCHAT:                       
	                                    JMP       CHECKCHAT
			
	NewLine1:                           
	                                    SCROLL    0, 0, 79, 11
	                                    MOV       Y_1, 11
	                                    JMP       ContinueSending
				
	COLOVERFLOW:                        
	                                    MOV       X_1, 0
	                                    INC       Y_1
	                                    CMP       Y_1, 12
	                                    JE        ROWOVERFLOW
	BACKCOLOVERFLOW:                    
	                                    JMP       BACKSEND
	ROWOVERFLOW:                        
	                                    SCROLL    0, 0, 79, 11
	                                    MOV       Y_1, 11
	                                    JMP       BACKCOLOVERFLOW
			

	ENDSEND:                            
	RES:                                
	                                    RECEIVING CharRecieved
	                                    CMP       CharRecieved, '$'
	                                    JE        JMPCHECKCHAT
				
	                                    CMP       CharRecieved, 0CH
	                                    JE        ENTRES
				
	                                    CMP       CharRecieved, 32
	                                    JE        BackspaceRES
				
	                                    Cursor    X_2, Y_2
	                                    MOV       AH, 9                                       	;Display string function
	                                    MOV       DX, offset CharRecieved                     	;offset of the string
	                                    INT       21H
	                                    INC       X_2
	                                    CMP       X_2, 80
	                                    JE        ColLimitCheckRec
	BACKSENDRES:                        
	                                    JMP       JMPCHECKCHAT
				
	ENTRES:                             
	                                    MOV       X_2, 0
	                                    ADD       Y_2, 1
	                                    CMP       Y_2, 24
	                                    JE        NewLine2
	ContinueReceiving:                  
	                                    Cursor    X_2, Y_2
	                                    JMP       JMPCHECKCHAT
				
	BackspaceRES:                       
	                                    Cursor    X_2, Y_2
	                                    MOV       AH, 9                                       	;Display string function
	                                    MOV       DX, offset Space_chat                       	;offset of the string
	                                    INT       21H
	                                    DEC       X_2
	                                    Cursor    X_2, Y_2
	                                    JMP       JMPCHECKCHAT
				
	NewLine2:                           
	                                    SCROLL    0, 0DH, 79, 24
	                                    Cursor    0, 12
	                                    MOV       AH, 9                                       	;Display string function
	                                    MOV       DX, offset Divisor                          	;offset of the string
	                                    INT       21H
	                                    MOV       Y_2, 23
	                                    JMP       ContinueReceiving
				
	ColLimitCheckRec:                   
	                                    MOV       X_2, 0
	                                    INC       Y_2
	                                    CMP       Y_2, 24
	                                    JE        RowLimitCheckRec
	ColLimitCheckFixRecBACK:            
	                                    JMP       BACKSENDRES
				
	RowLimitCheckRec:                   
	                                    SCROLL    0, 0DH, 79, 24
	                                    Cursor    0, 12
	                                    MOV       AH, 9                                       	;Display string function
	                                    MOV       DX, offset Divisor                          	;offset of the string
	                                    INT       21H
	                                    MOV       Y_2, 23
	                                    JMP       ColLimitCheckFixRecBACK
	
	                                    JMP       CHECKCHAT
		
	End_Of_Chat_Module:                 ret
	                   
ChatProc ENDP


Draw_Power_Up_Square proc
	
	                                    mov       si, offset Power_Up_1_X_location
	                                    lea       di, Power_Up_1_Activation
	                                    push      di
	                                    mov       di, offset Power_Up_1_End_X_location
	                                    mov       bl, Power_Ups_Counts
	                                    mov       bh, 0
	                                    mov       ax, Power_Up_1_Activation
	
	
	Start_Of_Draw_Power_Ups:            
	                                    cmp       ax, 0
	                                    Jz        Increment_Of_Power_Up_Data
	                                    mov       cx, 0
	                                    mov       dx, 0
	
	                                    mov       cx, [si]
	                                    add       si, 2
	                                    mov       dx, [si]
	                                    sub       si, 2

	                                    mov       ah, 0ch
	                                    mov       al, 0Eh

	Draw_Power_Up_1:                    int       10h
	                                    dec       cx
	                                    cmp       cx, [di]
	                                    jnz       Draw_Power_Up_1
	;mov si, offset Power_Up_1_X_location
	                                    mov       cx, [si]
	                                    dec       dx
	                                    cmp       dx, [di] +  2
	                                    jnz       Draw_Power_Up_1

	
	Increment_Of_Power_Up_Data:         
	                                    mov       ax, di
	                                    pop       di
	                                    add       di, 2
	                                    push      di
	                                    push      ax
	                                    mov       ax, [di]
	                                    pop       di
	                                    add       si, 4
	                                    add       di, 4
	                                    dec       bl
	                                    jnz       Start_Of_Draw_Power_Ups

	                                    pop       si

	                                    ret
Draw_Power_Up_Square endp
