	                                    ADD       CX,player1currentXpos
	                                    DEC       DX                                          	;iterate in y
	                                    CMP       DX,player1currentYpos
	                                    JZ        ReturnDrawplayer1                           	;finish drawing
	                                    JNZ       Drawit1                                     	;continue drawing

	ReturnDrawplayer1:                  RET
