	level2:                             mov       Power_Up_1_Activation,1
	                                    mov       Power_Up_2_Activation,2
	                                    mov       Power_Up_3_Activation,0
	                                    mov       Power_Ups_Counts,2
	                                    mov       Box_1_Activation,2
	                                    mov       Box_2_Activation,2
	                                    mov       Box_3_Activation,0
